    <script>
    var exportKey = "index"; //index
    var canvas, stage, exportRoot, anim_container, dom_overlay_container, fnStartAnimation;

    function init() {
        window.ancc.download.init({
            android: "https://play.google.com/store/apps/details?id=com.jp.beauty",
            ios: "https://itunes.apple.com/jp/app/id1391483863"
        }); //
        canvas = document.getElementById("canvas");
        anim_container = document.getElementById("animation_container");
        dom_overlay_container = document.getElementById("dom_overlay_container");
        var comp = AdobeAn.getComposition(Object.keys(AdobeAn.compositions).pop());
        var lib = comp.getLibrary();
        createjs.MotionGuidePlugin.install();
        var images = comp.getImages();
        lib.properties.manifest.forEach(function(e) {
            var id = e.id;
            var img = document.getElementById(id);
            if (img != null) {
                images[id] = img;
				img.parentElement.removeChild(img)
            }
			
        });
        handleComplete(null, comp);
        document.body.className = "";
        document.body.classList.remove("load");

        if(navigator.userAgent.match(/(safari)/gi)){
            document.body.classList.add("safari");
        }
    }

    function handleFileLoad(evt, comp) {
        var images = comp.getImages();
        if (evt && (evt.item.type == "image")) {
            images[evt.item.id] = evt.result;
        }
    }

    function handleComplete(evt, comp) {
        var lib = comp.getLibrary();

        exportRoot = new lib[exportKey]();
        stage = new lib.Stage(canvas);
        exportRoot.visible = false;
        fnStartAnimation = function() {
            stage.addChild(exportRoot);
            createjs.Ticker.setFPS(lib.properties.fps);
            createjs.Ticker.addEventListener("tick", stage);
        }
        AdobeAn.compositionLoaded(lib.properties.id);
        fnStartAnimation();
    }

    function playSound(id) {

        window.sound&&window.sound.play(id)
    }
    </script>
</head>
